import React, {useState} from'react';

function AlbumList(){
    const [albums, setAlbums] = useState([]);

    return (
        <div>
            <h1>Albums</h1>
            <ul>
                {albums.map(album => (
                    <li key={album.id}>{album.title}</li>
                ))}
            </ul>
        </div>
    );
}

export default AlbumList;
